import React from 'react';
import './authorization.css';

const Authorization = () => {

    return (
        <div className="auth-screen container justify-content-center">
            <div className="auth-block align-middle">
                <form method="post">
                    <h5>Authorization</h5>
                    <label>
                        Login
                        <input type="text" name="title" placeholder="..." className="form-control"/>
                    </label>
                    <br/>
                    <label>
                        Password
                        <input type="text" name="anons" placeholder="..." className="form-control"/>
                    </label>
                    <br/>
                    <button type="submit" className="btn btn-info">Log in</button>
                </form>
                <button className="btn btn-info">Registration</button>
            </div>
        </div>
    )

};

export default Authorization;
